webpackJsonp([66627555459148],{7572:function(e,t){e.exports={data:{post:{html:"<p>I've been pretty quiet here the past week. Mama was gone 5 days, including last weekend, Christopher had short days for school testing and a home day on Friday, and I've been up to my ears in work. (I installed a new mail server, but the old server died before the all the users were migrated. And that was just one of several problems.)</p>\n<p>But things are looking up. Spring is here, the snow is almost gone. Mama has a business-trip-free April. And the three of us are splitting next weekend to <a href=\"http://www.dorintresorts.com/stralsund\">Stralsund</a>. I'm sure that clear thinking will resume shortly.</p>",fields:{title:"Where Am I? Who Am I?",date:"25 Mar 2006",url:"https://papascott.de/2006-03-25-where-am-i-who-am-i/"}}},pathContext:{slug:"/2006-03-25-where-am-i-who-am-i/",prev:{fields:{title:"Poor Sun",date:"20 Mar 2006",slug:"/2006-03-20-poor-sun/"}},next:{fields:{title:"School 2.0",date:"01 Apr 2006",slug:"/2006-04-01-school-20/"}}}}}});
